import React, { Component } from "react";
import mascote3 from "../img/macaco-caolho-mascote3.png";
import WOW from "wowjs";

class Header extends Component {
  componentDidMount() {
    const wow = WOW();

    wow.init();
  }

  render() {
    return (
      <div>
        <div className="welcome wow bounceIn">
          <h1 id="welcome">Macaco Caolho</h1>
          <h1 id="rock">Rock n' Drinks</h1>
        </div>

        <div class="container-sm" id="imgMacaco">
          <img src={mascote3} />
        </div>
      </div>
    );
  }
}

export default Header;
